def checkGRZ(grz):
    url = "http://тест.атимо.рф/Taksopark/hs/WebApp/GetDataGRZ?grz="+grz
    response = requests.request("GET", url, headers=headers, data="")
    data=json.loads(response.text)
    grzInfo=[None,None,None,None,None]
    for datas in data:
        if datas == "Success":
                grzInfo[0]=data[datas]
        if datas == "Car":
                grzInfo[1]=data[datas]
        if datas ==  "Driver":
                grzInfo[2]=data[datas]
        if datas ==  "Act_number":
                grzInfo[3]=data[datas]
        if datas ==  "Rent_number":
                grzInfo[4]=data[datas]
    return grzInfo

def checkUser(userPhone):
    payload = json.dumps({
    "Telephone": userPhone
    })
    url = "http://тест.атимо.рф/Taksopark/hs/WebApp/UserAuthorization"
    response = requests.request("GET", url, headers=headers, data=payload)
    data=json.loads(response.text)
    if data["Success"]==True:
        contacts = [
            data["Success"],
            data["User"]
        ]  
        return contacts
    else:
        contacts = [
            data["Success"]
        ]
        return contacts  
  
    

